import React from 'react';
import Title from "../components/basic/title/Title";
import HeaderCart from "../components/user/header_cart/HeaderCart";
import CardCartList from "../components/user/card_list/CardCartList";
import ItogPrice from "../components/user/cart/itog_price/ItogPrice";

const Cart = () => {
    return (
        <div>
            <HeaderCart/>
            <div className="title_padd">
                <Title props="Корзина"/>
                <CardCartList/>
                <ItogPrice/>
            </div>
        </div>
    );
};

export default Cart;
